import React from 'react';

class State extends React.Component {
  constructor(props) {
    super(props);
    this.state = { stateValue: "Hello" };
  }

  render() {
    return (
      <div>
        <h1>Examples:</h1>
        <p>This is the value in the state: {this.state.stateValue}</p>
      </div>
    );
  }
}

export default State;
